// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IUser {
    function isValidUser(address addr) external view returns(bool);
    function isValidUserHouse(address addr,uint houseId) external view returns(bool);
    function deductUnits(address userAdd,uint houseId, uint numOfUnits) external;
    function widthrawalUnitsFromOrder(address userAdd,uint houseId, uint numOfUnits) external;
    function doesUserHaveCoupon(address user, uint couponEnum) external view returns (bool);
    function availDiscount(address user, uint couponEnum) external view returns (uint);
}

