// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./IUser.sol";
import "hardhat/console.sol";

contract Marketplace {
    enum AdStatusEnum{
        Canceled,Sold,Live 
    }
    
    struct Ad{
        uint id;
        address _consumer;
        uint houseAddress;
        uint demandUnits;
        uint arrangedUnits;
        string date;
        uint pricePerUnit;
        AdStatusEnum status;
    }
    
    IUser iUser;
    mapping(uint => Ad) public Ads;
    
    address public owner;
    IUser public userRegistery;
    uint id=1;

    constructor(IUser _userRegistory) {
        userRegistery = _userRegistory;
    }
    
    /* Place the ad in marketplace and update the Producer account*/
    function addAd(uint houseId, uint demandUnits, uint pricePerUnit,string memory date) external {
        require(userRegistery.isValidUser(msg.sender),"User has not registered yet. Register the account");
        require(userRegistery.isValidUserHouse(msg.sender,houseId),"House is not registered.");
        // userRegistery.deductUnits(msg.sender,houseId,demandUnits);
        
        Ads[id] = Ad({
            id: id,
            _consumer: msg.sender,
            houseAddress: houseId,
            demandUnits: demandUnits,
            arrangedUnits: 0,
            date:date,
            pricePerUnit:pricePerUnit,
            status :AdStatusEnum.Live
        });
        id++;
    }

    /* Cancel the ad from marketplace and update the Producer account*/
    function cancelAd(uint adId) public {
        require(Ads[adId]._consumer==msg.sender,"Ad doesn't link with provided user");
        
        Ad storage ad= Ads[adId];
        userRegistery.widthrawalUnitsFromOrder(msg.sender, ad.houseAddress ,ad.demandUnits);

        ad.status=AdStatusEnum.Canceled;
    }


    //                  Orders
    struct  Order{
        uint orderId;
        address _consumer;
        address _producer;
        uint discountPercentage;
        uint numOfUnits;
        uint _consumerHouse;
    }
    mapping(uint=>Order) orders;
    uint orderCount;
    
    function order(uint adId, uint numOfUnitPurchase, uint transferAtHouseAddr,uint couponNum) public {
        require(userRegistery.isValidUser(msg.sender),"User has not registered yet. Register the account");
        require(userRegistery.isValidUserHouse(msg.sender,transferAtHouseAddr),"House is not registered.");
        require(Ads[adId].id != 0 ,"Ad Doesn't Exist");
        require(Ads[adId].status!=AdStatusEnum.Canceled  || Ads[adId].status!=AdStatusEnum.Sold,"Ad Doesn't Exist");
        require(Ads[adId].demandUnits - Ads[adId].arrangedUnits  >= numOfUnitPurchase 
        ,"Number of unit want to purchase exceed from the Ad limit");
        Ad storage ad = Ads[adId];
        uint discount = 0;
        
        require(userRegistery.doesUserHaveCoupon(msg.sender,couponNum),"Doesn't Have Coupon to avail discount");
        discount = userRegistery.availDiscount(msg.sender,couponNum);
        
        
        ad.arrangedUnits += numOfUnitPurchase; // Update Ad's sold units

        orders[orderCount++] = Order({
            orderId:orderCount,
            _consumer: ad._consumer,
            _producer: msg.sender,
            discountPercentage: discount,
            numOfUnits: numOfUnitPurchase, 
            _consumerHouse:transferAtHouseAddr
        });
    }
    
    function getAllAds() public view returns (Ad[] memory) {
        Ad[] memory allAds = new Ad[](id-1);
        for (uint i = 1; i < id; i++) {
            allAds[i - 1] = Ads[i];
        }
        return allAds;
    }

    function emitAllAds() public {
        Ad[] memory allAds = getAllAds();
        uint[] memory adIds = new uint[](allAds.length);
        address[] memory consumers = new address[](allAds.length);
        uint[] memory houseAddresses = new uint[](allAds.length);
        uint[] memory demandUnits = new uint[](allAds.length);
        uint[] memory arrangedUnits = new uint[](allAds.length);
        string[] memory dates = new string[](allAds.length);
        uint[] memory prices = new uint[](allAds.length);
        AdStatusEnum[] memory statuses = new AdStatusEnum[](allAds.length);
        
        for (uint i = 0; i < allAds.length; i++) {
            Ad memory ad = allAds[i];
            adIds[i] = ad.id;
            consumers[i] = ad._consumer;
            houseAddresses[i] = ad.houseAddress;
            demandUnits[i] = ad.demandUnits;
            arrangedUnits[i] = ad.arrangedUnits;
            dates[i] = ad.date;
            prices[i] = ad.pricePerUnit;
            statuses[i] = ad.status;
        }

        emit AdsList(adIds, consumers, houseAddresses, demandUnits, arrangedUnits, dates, prices, statuses);
    }

    // Event for emitting ads list
    event AdsList(
        uint[] adIds, 
        address[] consumers,
        uint[] houseAddresses,
        uint[] demandUnits,
        uint[] arrangedUnits,
        string[] dates,
        uint[] prices,
        AdStatusEnum[] statuses
    );
}

